import React from 'react';
import "./RecipeCard.css";

function SearchBar({recipeName, recipeImage}) {
    return (
        <div className="card">
            <link rel="stylesheet" href="./RecipeCard.css" />
            <image href={recipeImage} alt={recipeName}/>
        </div>
    )
}

export default SearchBar;
